            <div className="container-fluid content bg-gradient">
                <br></br><a className="navbar-brand a-style" href="manageruser">manageruser</a>
                <a className="navbar-brand a-style" href="#">nav2</a>
                <a className="navbar-brand a-style" href="#">nav3</a>
            </div>
        </>
    )
}
